            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "State machine IRQ flags register. Write 1 to clear. There are 8 state\n"
                },
                {
                  "kind": "span",
                  "text": "machine IRQ flags, which can be set, cleared, and waited on by the state\n"
                },
                {
                  "kind": "span",
                  "text": "machines. There's no fixed association between flags and state machines\n"
                },
                {
                  "kind": "ul",
                  "children": [
                    {
                      "kind": "li",
                      "children": [
                        {
                          "kind": "span",
                          "text": "- any state machine can use any flag.\\n\\n Any of the 8 flags can be\n"
                        }
                      ]
                    }
                  ]
                },
                {
                  "kind": "span",
                  "text": "used for timing synchronisation between state machines, using IRQ and\n"
                },
                {
                  "kind": "span",
                  "text": "WAIT instructions. The lower four of these flags are also routed out to\n"
                },
                {
                  "kind": "span",
                  "text": "system-level interrupt requests, alongside FIFO status interrupts -- see\n"
                },
                {
                  "kind": "span",
                  "text": "e.g. IRQ0_INTE.\n"
                }
              ]
            }
